import React from 'react';

const portfolioDB = {
  users: [
    {
      id: 346364,
      school: 'California College of the Arts',
      major: 'Illustration',
      name: 'Chance Lipshutz',
      Year: 2020,
      Portfolio: [{ img: [], desc: '' }],
    },
    {
      id: 346365,
      school: 'New York University',
      major: 'Fine Arts',
      name: 'Allison Lubin',
      Year: 2021,
      Portfolio: [{ img: [], desc: '' }],
    },
    {
      id: 346366,
      school: 'University of Michigan',
      major: 'Design',
      name: 'Ann Carder',
      Year: 2019,
      Portfolio: [{ img: [], desc: '' }],
    },
  ],
};

export default portfolioDB;
